  width: 100%;
`;

const Title = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  > h1 {
    font-size: 20px;
    font-weight: bolder;
    color: blue;
  }
`;

class HomePage extends Component {
  render() {
    return (
      <Wrapper>
        {/* <Header /> */}
        <Title>
          <h1>HomePage</h1>
        </Title>
      </Wrapper>
    );
  }
}

export default HomePage;
